--------------------------------------------------------------------------------
-- Simple huffman compression
--------------------------------------------------------------------------------

theTree :: Tree String
--theTree = huffman betterHisto
theTree = h3
theTreeEnc :: Map.Map String [Bit]
theTreeEnc = Map.fromList $ huffmanMap theTree

compress, decompress :: String -> String

-- Compression using table
compress = encode . concat . unfoldr step . (++"@")
   where step :: String -> Maybe ([Bit],String)
         step [] = Nothing
         step xs = case
                     [ Just (bits,ys)
                     | n <- [3,2,1]
                     , let (x,ys) = splitAt n xs
                     , Just bits <- return $ Map.lookup x theTreeEnc
                     ] of
                    (c:_) -> c
                    []    -> error $ "unable to compress " ++ show (take 10 xs)

-- De compression
decompress = takeWhile (/='@') . concat . unfoldr (Just . huffmanDecode theTree) . decode

--------------------------------------------------------------------------------
-- Text statistics
--------------------------------------------------------------------------------

baseHisto :: Map.Map String Int
baseHisto = Map.fromList $ [ ([x],1) | x <- ['a'..'z']++['A'..'Z']++['0'..'9']++" ." ] ++ [("@",0)]

ngrams :: Int -> String -> Map.Map String Int
ngrams n xs = Map.fromListWith (+) [ (take n ys,1) | ys <- tails xs ]

histo n limit text = Map.unionWith (+) baseHisto $ Map.filter (>= limit)
                   $ Map.unionsWith (+) $ map (ngrams n . (++"@")) (lines text)

